            boolean expectedState = isPerfectSquare(i);
            assertEquals(expectedState, doors[i], "Door " + i + " state is incorrect.");
        }
    }

    private boolean isPerfectSquare(int number) {
        int sqrt = (int) Math.sqrt(number);
        return sqrt * sqrt == number;
