      if(!isEven(first)){
          sum += second;
      }
    }while(first > 1);
 
    System.out.println(sum);
  }
 
  public static int doubleInt(int doubleMe){
    return doubleMe << 1; //shift left
  }
 
  public static int halveInt(int halveMe){
    return halveMe >>> 1; //shift right
  }
 
  public static boolean isEven(int num){
    return (num & 1) == 0;
  }
