        private final String onomatopoeia;
 
        public Sound(int trigger, String onomatopoeia) {
            this.trigger = trigger;
            this.onomatopoeia = onomatopoeia;
        }
 
        public String generate(int i) {
            return i % trigger == 0 ? onomatopoeia : "";
        }
 
    }
 
}

