        int count = 0, index = 0;
        int[] totals = new int[numbers.length];
        for (int longPrime : longPrimes) {
            if (longPrime > numbers[index]) {
                totals[index++] = count;
            }
            ++count;
        }
        totals[numbers.length - 1] = count;

        assertArrayEquals(expectedTotals, totals);
    }
